import { useEffect } from 'react';

/**
 * トップ画面
 * @returns
 */
function Top() {
	useEffect(() => {
		document.title = 'ShareJob';
	}, []);
	return (
		<div>
			<h1>shareJobへようこそ!</h1>
			本サイトでは主に以下のことができます
			<ul>
				<li>就職活動の状況の登録、管理</li>
				{/* <li>項目2</li> */}
			</ul>
			<h2>就職活動の状況の登録、管理</h2>
			<p>
				各企業に対する就職活動の状況をメモとして登録することができます。
				<br></br>
			</p>
			<p>
				ホーム画面の右下の+ボタンを押すと企業検索画面に移るのでそこから企業を登録して選考状況を登録できます。
			</p>
		</div>
	);
}

export default Top;
